import React from 'react';
import './Contact.css'; // Import the CSS file

const Contact = () => {
  return (
    <div>
      <div className="second_container">
        <h1>Contact Us</h1>
        <p>This is the Contact Us page.</p>
      </div>
      <div className="ticket">
        <h2>samran</h2>
      </div>
    </div>
  );
};

export default Contact;
